import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <View style={styles.headreContainer}>
           
        </View>
    );
}

const styles = StyleSheet.create({
    headreContainer: {
        position: 'absolute',
        width: '375px',
        height: '302px',
        left: 0,
        top: 0,
        backgroundColor: "#24C&D6",
    },
    
})

export default Header;
